import { Link, Wrapper } from "./styles";

import Headroom from "react-headroom";
import React from "react";
import links from "./links";

export default () => {
	return (
		<Headroom>
			<Wrapper>
				<Logo />
				<LinkList>
					<Link>{links}</Link>
				</LinkList>
			</Wrapper>
		</Headroom>
	);
};
